import React from 'react';

const ShowPopupForm = () => {
  return (
    <form className='popupform_grid'>
        <input type="text" name="" id="taskname_input" />
        <input type="date" name="" id="taskenddate_input" />
        <input type="time" name="" id="taskendtime_input" />
        <input type="checkbox" name="" id="taskfavourite_input" />
        <input type="checkbox" name="" id="" />
        <button type="reset"></button>
        <button type="submit"></button>
    </form>
  )
};

export default ShowPopupForm;
